                    hashCode = hashCode * 59 + this.ShortcutNum.GetHashCode();
                hashCode = hashCode * 59 + this.TaxCode.GetHashCode();
                if (this.WalletableId != null)
                    hashCode = hashCode * 59 + this.WalletableId.GetHashCode();
                return hashCode;
            }
        }

    }

}
